import styled from "styled-components";

const Box = styled.div`
position: relative;
top: 110px;
left: 150px;
background-color: aqua;
width: 800px;
`

const Head = styled.h1`
  position: relative;
  top: 20px;
  display: flex;
  justify-content: center;
  align-items: center;
  color: #444;
`;

function Home() {
  return (
    <Box>
      <Head>Bem-Vindo !!</Head>
    </Box>
  );
}

export default Home;
